import { Route, Routes, BrowserRouter } from "react-router-dom";
import Welcome from "./components/Welcome";
import Products from "./components/Products";

function App() {
  return (
    <div>
      <h2>hellooo</h2>
      <BrowserRouter>
        <Routes>
          <Route path="/welcome">
            <Welcome />
          </Route>
          <Route path="/Products">
            <Products />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
